import {Button} from "react-bootstrap";


export default function EditableUserProfile({
    stored,
    startEditCallback
}) {
    return <div>
        <Group>
            <h2>Name:</h2> {stored.name}
        </Group>
        <Group>
            <h2>Do you want to delete your account?</h2>
            <Button type="submit">Delete</Button>
        </Group>
    </div>
}
